window.bookSummaryJSON = "<p>With the Tuathan Brotherhood taken care of, Ember and the Wild Hunt gear up for the coming darkness that threatens to plunge their lives into chaos. But first, they take on the ancient liche who stole Talia's powers. Lazarus is living near Winter Hall Magical Academy, located near Mt. Rainier. Over the centuries, he's grown so strong that it seems futile to take him on. But with Lazarus stalking the students, stealing not only their magical powers but their lives, the Wild Hunt can't allow him to roam free. Before they can confront him, Talia takes it on herself to reconnoiter the situation and ends up trapped in a maniacal web that easily spell her death. Now, Ember and Herne must race against time before Lazarus finds her first.</p>"; 
